pragma solidity ^0.8.0;

import "../math/Math.sol";

/**
 * @dev Collection of functions related to array types.
 */

library Arrays {
    
    modifier AddressGreaterThen ( address[] memory _array, uint256 _n ) {
        require( _array.length <= _n, "Array: contains too many elements" );
        _;
    }

    modifier UintGreaterThen ( uint256[] memory _array, uint256 _n ) {
        require( _array.length <= _n, "Array: contains too many elements" );
        _;
    }

    modifier AddressGreaterThenZero ( address[] memory _array ) {
        require( _array.length > 0, "Array: contains zero elements" );
        _;
    }

    modifier UintGreaterThenZero ( uint256[] memory _array ) {
        require( _array.length > 0, "Array: contains zero elements" );
        _;
    }

    modifier AddressPayableGreaterThen ( address payable[] memory _array, uint256 _n ) {
        require( _array.length <= _n, "Array: contains too many elements" );
        _;
    }

    modifier AddressPayableGreaterThenZero ( address payable[] memory _array ) {
        require( _array.length > 0, "Array: contains zero elements" );
        _;
    }

    

    function AddressGreaterThenN ( address[] memory _array, uint256 _n ) internal pure AddressGreaterThen ( _array, _n ) returns ( bool )
    {
        return true;
    }

    function AddressGreaterThenZeroN ( address[] memory _array ) internal pure AddressGreaterThenZero ( _array ) returns ( bool ) 
    {
        return true;
    }

    function UintGreaterThenN ( uint256[] memory _array, uint256 _n ) internal pure UintGreaterThen ( _array, _n ) returns ( bool ) 
    {
        return true;
    }

    function UintGreaterThenZeroN ( uint256[] memory _array ) internal pure UintGreaterThenZero ( _array ) returns ( bool )
    {
        return true;
    }

    function AddressPayableGreaterThenN ( address payable[] memory _array, uint256 _n ) internal pure AddressPayableGreaterThen ( _array, _n ) returns ( bool )
    {
        return true;
    }

    function AddressPayableGreaterThenZeroN ( address payable[] memory _array ) internal pure AddressPayableGreaterThenZero ( _array ) returns ( bool ) 
    {
        return true;
    }


    function elementSearch ( address [] memory _array, address _x )  internal pure returns ( bool )
    {
        for ( uint256 i = 0; i < _array.length; i++)
        {
            if ( _array[i] == _x )
            {
                return true;
            }
        }

        return false;
    }


    function findUpperBound ( uint256[] memory _array, uint256 _element ) internal pure returns ( uint256 ) 
    {
        if (_array.length == 0) {
            return 0;
        }

        uint256 low = 0;
        uint256 high = _array.length;

        while (low < high) {
            uint256 mid = Math.average(low, high);
            if (_array[mid] > _element) {
                high = mid;
            } else {
                low = mid + 1;
            }
        }

        if (low > 0 && _array[low - 1] == _element) {
            return low - 1;
        } else {
            return low;
        }
    }

